import React from 'react';
import MenuRoundedIcon from '@material-ui/icons/MenuRounded';

const App = () => {

    const menuToggle = () => {
        const toggle = document.getElementById('menu_icon_id');

        (toggle.style.display == 'none') ? (toggle.style.display) = 'block' : (toggle.style.display) = 'none';
    }

    return (
        <>
            <div className="home_main">
                <div className="header">
                    <div className="logo_div">
                        <a href="#"><h2>logo</h2></a>
                    </div>
                    <div className="menu_div">
                        <ul>
                            <li><a href="#">Explore</a></li>
                            <li><a href="#">Upload</a></li>
                            <li><a href="#">Premium</a></li>
                            <li><a href="#">Help?</a></li>
                        </ul>
                    </div>
                    <div className='menu_icon' id='menu_icon_id'>
                        <MenuRoundedIcon onClick={menuToggle}/>
                    </div>
                </div>
                <div className="hero"></div>
                <div className="footer"></div>
            </div>
        </>
    );

}

export default App;
